// App.jsx or your main page component
import React from "react";
import Navbar from "./components/Navbar/Navbar";

const App = () => {
  return (
    <div>
      <Navbar />

      {/* Intro Section */}
      <section id="intro" className="h-screen flex items-center justify-center bg-green-100">
        <h1 className="text-4xl text-blue-900 font-bold">Welcome to My Portfolio</h1>
      </section>

      {/* Skills / About Section */}
      <section id="skills" className="h-screen flex flex-col items-center justify-center bg-green-200">
        <h2 className="text-3xl text-blue-900 font-semibold mb-4">About Me</h2>
        <p className="text-blue-900 max-w-xl text-center">
          Hi! Iâ€™m Yusriyah Rahman, a frontend developer passionate about building responsive and beautiful web applications.
        </p>
      </section>

      {/* Projects Section */}
      <section id="myPortfolio" className="h-screen flex flex-col items-center justify-center bg-green-300">
        <h2 className="text-3xl text-blue-900 font-semibold mb-4">Projects</h2>
        <p className="text-blue-900 max-w-xl text-center">Here are some of my projects...</p>
      </section>

      {/* Experience Section */}
      <section id="experience" className="h-screen flex flex-col items-center justify-center bg-green-400">
        <h2 className="text-3xl text-blue-900 font-semibold mb-4">Experience</h2>
        <p className="text-blue-900 max-w-xl text-center">My professional experience includes...</p>
      </section>

      {/* Contact Section */}
      <section id="contactPage" className="h-screen flex flex-col items-center justify-center bg-green-500">
        <h2 className="text-3xl text-blue-900 font-semibold mb-4">Contact Me</h2>
        <p className="text-blue-900 max-w-xl text-center">Reach out via email or LinkedIn!</p>
      </section>
    </div>
  );
};

export default App;
